import { NavLink } from 'react-router-dom';

const Header = () => {
    return (
        <header>
            <h1>Book Management App</h1>
            <hr />
            <div className="links">
                <NavLink to="/" className="link" activeclassname="active" exact>
                    Books List
                </NavLink>
                <NavLink to="/" className="link" activeClassName="active">
                    Add Book
                </NavLink>
            </div>
        </header>
    );
};

export default Header;
